/* Procedure structure for procedure `sp_delete_user` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_delete_user` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_delete_user`(IN `usr_id` INT)
BEGIN
	DELETE FROM auth_user_groups WHERE user_id = usr_id;
    DELETE FROM api_userprofile WHERE user_id = usr_id;
    DELETE FROM auth_user WHERE id = usr_id;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_loan_per_month` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_loan_per_month` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_loan_per_month`(IN `start_date` DATE, IN `end_date` DATE)
BEGIN
    SELECT 
    DATE_FORMAT(created_on, '%b') as month, 
    SUM(total) as total_amount
    FROM api_loan
    WHERE created_on BETWEEN start_date AND end_date
    GROUP BY MONTH(created_on);
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_loan_per_year` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_loan_per_year` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_loan_per_year`()
BEGIN
    SELECT 
    YEAR(created_on) as year, 
    SUM(total) as total_amount
    FROM api_loan
    GROUP BY YEAR(created_on);
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_update_profile` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_update_profile` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_update_profile`(IN `usr_id` INT, IN `user_username` VARCHAR(20), IN `user_first_name` VARCHAR(20), IN `user_last_name` VARCHAR(20), IN `user_email` VARCHAR(20))
BEGIN
	UPDATE auth_user SET username = user_username, first_name = user_first_name, last_name = user_last_name, email = user_email WHERE id = usr_id;
