DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_update_user`(IN `usr_id` INT, IN `user_username` VARCHAR(20), IN `user_first_name` VARCHAR(20), IN `user_last_name` VARCHAR(20), IN `user_email` VARCHAR(20), IN `g_id` INT)
