    DELETE FROM auth_user_groups WHERE user_id = usr_id;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_get_unpaid_loans` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_get_unpaid_loans` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`inv-pane`@`%` PROCEDURE `sp_get_unpaid_loans`()
BEGIN
  SELECT api_loan.*,
       MAX(api_payments.created_on) AS last_payment_date,
       CASE
           WHEN DATEDIFF(NOW(), api_loan.due_date) <= 30 THEN 'Within 30 days'
           WHEN DATEDIFF(NOW(), api_loan.due_date) <= 60 THEN 'Within 60 days'
           WHEN DATEDIFF(NOW(), api_loan.due_date) <= 90 THEN 'Within 90 days'
           ELSE 'Over 90 days'
       END AS payment_due,
       SUM(api_payments.paid) AS total_amount_paid,
       ROUND(api_loan.total / api_loan.months, 2) AS expected_monthly_payment,
       auth_user.first_name,
       auth_user.last_name,
       DATEDIFF(NOW(), api_loan.due_date) AS days_overdue
FROM api_loan
LEFT JOIN api_payments ON api_loan.id = api_payments.loan_id
LEFT JOIN api_loanfee ON api_loan.loan_fees_id = api_loanfee.id
LEFT JOIN auth_user ON api_loanfee.member_id = auth_user.id
WHERE api_loan.is_paid = 0 AND api_loan.due_date < NOW()
GROUP BY api_loan.id;

  END */$$
DELIMITER ;

